import React from "react";
import { useHistory } from "react-router-dom";
import BootstrapTable from "react-bootstrap-table-next";
import paginationFactory from "react-bootstrap-table2-paginator";
import { ActionsColumnFormatter } from "./ActionsColumnFormatter";
import { useIntl } from "react-intl";
import SVG from "react-inlinesvg";
import { toAbsoluteUrl } from "../../../../../../../../_metronic/_helpers";

const data = [
    {
        "id": 1,
        "code": "12535689",
        "duration": "12 Days Ago",
        "date": "10 APR 2022 10:23 AM",
        "distributor": "Bhai Bhai Enterprize",
        "balance": "570,168,000",
        "user": "Mmh Shohagh",
        "designation": "Accountant, Babylon Group",
        "payments": "500,000,000",
        "ord": "(+৳570,168 ORD)",
        "status": "Verify",
        "nature": "Advance(14)",
        "invoiceNo": "Invoice No. 12345678"
    },
    {
        "id": 2,
        "code": "12535689",
        "duration": "12 Days Ago",
        "date": "10 APR 2022 10:23 AM",
        "distributor": "Bhai Bhai Enterprize",
        "balance": "570,168,000",
        "user": "Mmh Shohagh",
        "designation": "Accountant, Babylon Group",
        "payments": "0",
        "ord": "(+৳570,168 ORD)",
        "status": "Verified",
        "nature": "Advance(14)",
        "invoiceNo": "Invoice No. 12345678"
    },
    {
        "id": 3,
        "code": "12535689",
        "duration": "12 Days Ago",
        "date": "10 APR 2022 10:23 AM",
        "distributor": "Bhai Bhai Enterprize",
        "balance": "570,168,000",
        "user": "Mmh Shohagh",
        "designation": "Accountant, Babylon Group",
        "payments": "500,000,000",
        "ord": "(+৳570,168 ORD)",
        "status": "Rejected",
        "nature": "Advance(14)",
        "invoiceNo": "Invoice No. 12345678"
    },
]
export default function HistoryList({ setSingleAll, singleAll }) {
    const intl = useIntl();
    let history = useHistory();

    const openAdjustPage = (data) => {
        history.push('/salescollection/payment-adjustment/payment-adjustment/invoices-adjust-view', { state: data });
    }

    const singleWiseSelectHandler = (data, isSelect) => {
        if (isSelect == true) {
            let temp = [...singleAll]
            temp.push(data)
            setSingleAll(temp)
        } else {
            if (singleAll.length >= 0) {
                let temp = [...singleAll]
                const index = temp.findIndex(obj => obj.id == data.id);
                temp.splice(index, 1);
                setSingleAll(temp)
            }
        }

    }
    const allSelectHandler = (allData, isSelect) => {
        if (isSelect == true) {
            setSingleAll(allData)
        }
        else {
            if (allData.length >= 0) {
                for (let i = 0; i < allData.length; i++) {
                    const index = singleAll.findIndex(obj => obj.id == allData[i].id);
                    singleAll.splice(index, 1);
                    setSingleAll(singleAll)
                }
            }
        }

    }
    const columns = [
        {
            dataField: "duration",
            text: "PAYMENT RECEIVE INFO",
            formatter: (cellContent, row) => (
                <>
                    <span className="text-muted">{row.code}</span><br />
                    <strong>{row.duration}</strong><br />
                    <span className="text-muted">{row.date}</span>
                </>
            )
        },
        {
            dataField: "distributor",
            text: "DISTRIBUTORS",
            formatter: (cellContent, row) => (
                <>
                    <strong>{row.distributor}</strong><br />
                    <span className="text-muted">Balance {row.balance}</span>
                </>
            )
        },
        {
            dataField: "user",
            text: "ENTRY BY",
            formatter: (cellContent, row) => (
                <>
                    <strong>{row.user}</strong><br />
                    <span className="text-muted">{row.designation}</span>
                </>
            )
        },
        {
            dataField: "collection_amount",
            text: "INVOICE PAYMENT AMOUNT",
            formatter: (cellContent, row) => (
                <>
                    <strong>{row.balance}&nbsp;<span className="dark-success-color">{row.ord}</span></strong><br />
                    <span className="text-muted">{row.invoiceNo}</span>
                </>
            )
        }
    ];

    return (
        <>
            <BootstrapTable
                wrapperClasses="table-responsive"
                classes="table table-head-custom table-vertical-center overflow-hidden"
                bootstrap4
                bordered={false}
                keyField="id"
                data={data}
                columns={columns}
                selectRow={
                    {
                        mode: 'checkbox',
                        onSelect: (row, isSelect, rowIndex, e) => {
                            singleWiseSelectHandler(row, isSelect);
                        },
                        onSelectAll: (isSelect, rows, e) => {
                            allSelectHandler(rows, isSelect);

                        }

                    }
                }

                pagination={paginationFactory({ sizePerPage: 10, showTotal: true })}
            />
        </>
    );
}
